import React, { useState } from 'react'
import ChildDataEmployee from './ChildDataEmployee'

const GetData =(props)=>{
    const Employee = [
        {id:1, firstName: 'pasya', lastName: 'Sholeh', pekerjaan: 'Web Developer', status: 'Married' },
        {id:1, firstName: 'john', lastName: 'doe', pekerjaan: 'Web Developer', status: 'Married' },
        {id:1, firstName: 'jane', lastName: 'doe', pekerjaan: 'Designer', status: 'Single' }
    ]
      const [data] = useState(Employee)
    return (
        <div>
         <ChildDataEmployee hasil={data}/>
        </div>

    )
}
export default GetData
